import React from "react";
import { NavLink } from "react-router-dom";
const Main = () => {
    return (
        <>
            <nav className="navbar navbar-expand-lg bg-body-tertiary">
                <div className="container-fluid">
                    <NavLink className="navbar-brand" to={'/'}>Nestify </NavLink>
                    <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarNavAltMarkup" aria-controls="navbarNavAltMarkup" aria-expanded="false" aria-label="Toggle navigation">
                        <span className="navbar-toggler-icon" />
                    </button>
                    <div className="collapse navbar-collapse" id="navbarNavAltMarkup">
                        <div className="navbar-nav">
                            <NavLink className="nav-NavLink m-2" aria-current="page" to={'/'}>Home</NavLink>
                            <NavLink className="nav-NavLink m-2" to={'/login'}>Login</NavLink>
                            <NavLink className="nav-NavLink m-2" to={'/register'}>Register</NavLink>
                            {/* <NavLink className="nav-NavLink disabled" aria-disabled="true">Disabled</NavLink> */}
                        </div>
                    </div>
                </div>
            </nav>
            <div className="dropdown"></div>

        </>
    )
}

export default Main;
